import './App.css';
import Navbar from './Navbar'
import Searchbox from './Searchbox';

function App() {
  const myTheme = createMuiTheme({
    palette:{
      type:"dark"
    },
  });
  return (
    <ThemeProvider theme = {myTheme}>
      <div className="App">
        <Navbar/>
        <Searchbox/>
      </div>
    </ThemeProvider>

  );
}

export default App;

